import React, { Component } from 'react'
import { Card, CardContent, InputBase } from '@material-ui/core';

export default class AddNoteComponent extends Component {
    render() {
        return (
            <div>
                <Card>
                    <CardContent>
                    <InputBase
                                className="InputBase"
                                placeholder="Title" />
                    </CardContent>
                </Card>
            </div>
        )
    }
}
